gCJ(){return" Soy Ingeniero Electr\xf3nico con m\xe1s de siete a\xf1os de experiencia en el desarrollo de software, firmware y aplicaciones, con trayectoria en sectores altamente exigentes como la industria m\xe9dica y la financiera. Mi formaci\xf3n t\xe9cnica, sumada a la experiencia pr\xe1ctica en entornos regulados, me permite abordar proyectos complejos con una visi\xf3n integral: desde la concepci\xf3n inicial hasta la implementaci\xf3n final, asegurando calidad, eficiencia y cumplimiento normativo.\n\nA lo largo de mi carrera he participado en proyectos de alto impacto, entre ellos la creaci\xf3n y puesta en el mercado de dispositivos m\xe9dicos certificados y el desarrollo de soluciones de software cr\xedticas para sistemas financieros. Estos proyectos no solo exigieron un dominio profundo de lenguajes de programaci\xf3n, sino tambi\xe9n la capacidad de gestionar calidad bajo normas internacionales como ISO 13485. Gracias a estas experiencias he logrado resultados concretos, como la reducci\xf3n de costos productivos, la optimizaci\xf3n de procesos de control de calidad y la implementaci\xf3n de soluciones robustas y seguras en entornos de producci\xf3n.\n\nEn mi rol actual como desarrollador freelance, me especializo en el dise\xf1o y construcci\xf3n de aplicaciones m\xf3viles multiplataforma utilizando Flutter, con integraciones en Firebase, APIs externas y servicios en la nube. Mi objetivo es entregar aplicaciones escalables, seguras y orientadas al usuario final, que aporten valor real a las organizaciones. La experiencia adquirida en la industria me permite traducir necesidades de negocio en soluciones tecnol\xf3gicas viables, equilibrando innovaci\xf3n, calidad y eficiencia."},
